SELECT MAX("title"."imdb_id") AS agg_0, MAX("title"."season_nr") AS agg_1, MAX("movie_keyword"."movie_id") AS agg_2, MAX("title"."series_years") AS agg_3, MAX("title"."episode_nr") AS agg_4, MAX("keyword"."keyword") AS agg_5, MAX("title"."md5sum") AS agg_6, MAX("movie_keyword"."keyword_id") AS agg_7, MAX("movie_keyword"."id") AS agg_8 FROM "movie_keyword" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id" LEFT OUTER JOIN "title" ON "movie_keyword"."movie_id" = "title"."id" WHERE "title"."season_nr" >= 1.1714336491921395 AND "title"."episode_nr" <= 42.154882771779455 AND "movie_keyword"."keyword_id" <= 2291 AND "keyword"."id" <= 1749;
SELECT SUM("movie_companies"."company_id") as agg_0 FROM "company_name" LEFT OUTER JOIN "movie_companies" ON "company_name"."id" = "movie_companies"."company_id" LEFT OUTER JOIN "company_type" ON "movie_companies"."company_type_id" = "company_type"."id"  WHERE "company_name"."country_code" != '%[uz]%' AND "movie_companies"."movie_id" <= 1134583 AND "company_type"."id" IS NOT NULL;
SELECT "aka_name"."imdb_index", COUNT(*) AS agg_0, COUNT(*) AS agg_1 FROM "aka_name" LEFT OUTER JOIN "name" ON "aka_name"."person_id" = "name"."id" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id" WHERE "name"."surname_pcode" <> '%F354%' AND "name"."imdb_index" <> '%II%' GROUP BY "aka_name"."imdb_index" ORDER BY "aka_name"."imdb_index";
SELECT "company_name"."country_code", COUNT(*) as agg_0, AVG("movie_companies"."id") as agg_1 FROM "company_name" LEFT OUTER JOIN "movie_companies" ON "company_name"."id" = "movie_companies"."company_id"  WHERE "movie_companies"."company_id" <= 1015 AND "movie_companies"."movie_id" <= 766124 AND "company_name"."id" <= 222003 GROUP BY "company_name"."country_code" ORDER BY "company_name"."country_code";
SELECT SUM("movie_companies"."id") as agg_0, SUM("movie_companies"."movie_id") as agg_1 FROM "company_type" LEFT OUTER JOIN "movie_companies" ON "company_type"."id" = "movie_companies"."company_type_id"  WHERE "company_type"."id" = 2 AND "movie_companies"."movie_id" <= 2466026 AND "movie_companies"."company_type_id" != 1 AND "company_type"."kind" != '%production companies%';
SELECT SUM("cast_info"."person_id") AS agg_0, AVG("cast_info"."nr_order") AS agg_1 FROM "aka_name" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" WHERE "aka_name"."surname_pcode" <> '%N1%' AND "cast_info"."nr_order" <= 0.8738067354039554;
SELECT AVG("title"."kind_id") as agg_0 FROM "link_type" LEFT OUTER JOIN "movie_link" ON "link_type"."id" = "movie_link"."link_type_id" LEFT OUTER JOIN "title" ON "movie_link"."movie_id" = "title"."id"  WHERE "link_type"."link" != '%spoofed in%' AND "movie_link"."linked_movie_id" >= 2129206 AND "movie_link"."id" >= 2610;
SELECT AVG("cast_info"."person_role_id") AS agg_0 FROM "cast_info" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" WHERE "title"."production_year" >= 2010.4447910019467 AND "cast_info"."nr_order" >= 24.13180475639112 AND "cast_info"."movie_id" <= 12032493;
SELECT "title"."series_years", COUNT(*) as agg_0, AVG("movie_link"."movie_id") as agg_1 FROM "movie_link" LEFT OUTER JOIN "link_type" ON "movie_link"."link_type_id" = "link_type"."id" LEFT OUTER JOIN "title" ON "movie_link"."movie_id" = "title"."id"  WHERE "link_type"."link" != '%featured in%' AND "title"."season_nr" <= 879.1182174938509 GROUP BY "title"."series_years" ORDER BY "title"."series_years";
SELECT "title"."imdb_index", SUM("title"."kind_id") AS agg_0, COUNT(*) AS agg_1 FROM "cast_info" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" WHERE "title"."season_nr" <= 2.247977373419542 AND "title"."kind_id" <= 47 GROUP BY "title"."imdb_index" ORDER BY "title"."imdb_index";
SELECT COUNT(*) as agg_0, AVG("movie_keyword"."movie_id") as agg_1 FROM "movie_keyword" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id"  WHERE "keyword"."id" >= 17571 AND "movie_keyword"."id" >= 1228188 AND "movie_keyword"."movie_id" >= 1725080;
SELECT SUM("movie_keyword"."id") as agg_0 FROM "movie_keyword" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id"  WHERE "keyword"."id" <= 41861 AND "movie_keyword"."id" >= 3182683 AND "movie_keyword"."movie_id" <= 1976000;
SELECT AVG("person_info"."person_id") AS agg_0, AVG("person_info"."info_type_id") AS agg_1 FROM "person_info" LEFT OUTER JOIN "name" ON "person_info"."person_id" = "name"."id" WHERE "name"."gender" <> '%f%';
SELECT MAX("movie_info_idx"."note") AS agg_0, MAX("title"."kind_id") AS agg_1, MAX("movie_info"."id") AS agg_2, MAX("title"."series_years") AS agg_3, MAX("movie_info"."info") AS agg_4, MAX("movie_info"."movie_id") AS agg_5, MAX("title"."phonetic_code") AS agg_6, MAX("title"."title") AS agg_7, MAX("movie_info"."note") AS agg_8, MAX("movie_info_idx"."info") AS agg_9, MAX("title"."episode_nr") AS agg_10 FROM "title" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" WHERE "movie_info_idx"."id" <= 142864 AND "movie_info"."movie_id" <= 150910;
